uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iChannel1; // TEXTURE SLOT 1: Mech Texture

// --- UNLOCKED PARAMETERS ---
// Motion & Camera
uniform float u_rot_speed;    // How fast the machine spins
uniform float u_evolve_speed; // How fast the parts reconfigure

// Fractal DNA (The Shape)
uniform float u_fold_scale;   // Shrink rate per iteration (Try 1.0 to 2.0)
uniform float u_fold_shift;   // Distance between folds (Try 0.5 to 2.0)
uniform float u_core_size;    // Size of the central pillar

// Material & Texture
uniform float u_tex_scale;    // Size of the metal texture pattern
uniform float u_roughness;    // Shiny vs Rusty metal

// Lighting & Atmosphere
uniform float u_shadow_soft;  // Sharp vs Soft shadows
uniform float u_ao_strength;  // Depth of crevices
uniform float u_glow_str;     // Brightness of the heat/energy
uniform float u_fog_density;  // Thickness of the air
uniform float u_light_x;      // Light position X
uniform float u_light_y;      // Light position Y

out vec4 fragColor;

// --- CONSTANTS ---
#define MAX_STEPS 100
#define MAX_DIST 20.0
#define SURF_DIST 0.001
#define ITERATIONS 5

// --- MATH UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0);
}

// --- TRIPLANAR TEXTURING ---
vec3 triplanar(vec3 p, vec3 n, float scale) {
    p *= scale;
    vec3 x = texture(iChannel1, p.yz).rgb;
    vec3 y = texture(iChannel1, p.zx).rgb;
    vec3 z = texture(iChannel1, p.xy).rgb;
    vec3 w = pow(abs(n), vec3(8.0)); // Blending sharpness
    w = w / (w.x + w.y + w.z);
    return x*w.x + y*w.y + z*w.z;
}

// --- THE PROCEDURAL MACHINE CORE ---
float mapMachine(vec3 p) {
    float t_evolve = iTime * u_evolve_speed;

    // 1. Global Breathing
    p.y += sin(p.x * 0.5 + t_evolve) * 0.1;

    // 2. Iterative Folding (Fractal Logic)
    float scale = 1.0;
    float orbitTrap = 1e20;

    // Parameters pulled from Uniforms
    float fScale = (u_fold_scale < 0.1) ? 1.4 : u_fold_scale;
    float fShift = (u_fold_shift < 0.1) ? 1.0 : u_fold_shift;

    for(int i = 0; i < ITERATIONS; i++) {
        // Fold Space
        p = abs(p) - vec3(fShift, fShift * 1.2, fShift * 1.5) * scale;

        // Animated Rotation (The DNA)
        float angle1 = t_evolve * 0.5 + float(i);
        float angle2 = t_evolve * 0.3 + float(i) * 0.7;

        p.xy *= rot(angle1);
        p.yz *= rot(angle2);

        // Scaling
        p *= fScale;
        scale *= fScale;

        orbitTrap = min(orbitTrap, length(p));
    }

    // The Folded Shape
    float d = sdBox(p, vec3(0.5, 2.5, 0.5)) / scale;

    // The Core Shape
    vec3 p_core = p; // Note: 'p' is already transformed by the loop! 
    // We want the core to be in World Space usually, but attaching it 
    // to the fractal space makes it part of the machine arms.
    // Let's reset the core to a simpler transform relative to the fractal.

    float cSize = (u_core_size < 0.1) ? 0.3 : u_core_size;
    float dCore = (length(p.xz) - cSize) / scale; // Cylinder-ish

    // Blend
    d = smin(d, dCore, 0.2 / scale);

    // Store Orbit Trap for coloring
    return d + floor(orbitTrap * 10.0) * 0.0001;
}

float map(vec3 p) {
    return mapMachine(p);
}

// --- LIGHTING ---
float softshadow(vec3 ro, vec3 rd, float k) {
    float res = 1.0;
    float t = 0.1; 
    for(int i=0; i<32; i++) {
        float h = map(ro + rd*t);
        res = min(res, k*h/t);
        if(res < 0.001) break;
        t += clamp(h, 0.02, 0.2);
        if(t > 5.0) break; 
    }
    return clamp(res, 0.0, 1.0);
}

float calcAO(vec3 p, vec3 n) {
    float occ = 0.0;
    float sca = 1.0;
    for(int i=0; i<5; i++) {
        float h = 0.01 + 0.1*float(i)/4.0;
        float d = map(p + n*h);
        occ += (h-d)*sca;
        sca *= 0.95;
    }
    return clamp(1.0 - 3.0*occ, 0.0, 1.0);
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(SURF_DIST, 0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Camera
    vec3 ro = vec3(0.0, 0.0, -6.0); 
    vec3 ta = vec3(0.0, 0.0, 0.0);
    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0,1,0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd + uv.x * right + uv.y * up);

    // Raymarching
    float t = 0.0;
    float d = 0.0;
    float t_rot = iTime * u_rot_speed; // World Rotation

    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * t;
        // Rotate World
        p.xz *= rot(t_rot * 0.3);
        p.xy *= rot(t_rot * 0.1);

        d = map(p);
        if(abs(d) < SURF_DIST || t > MAX_DIST) break;
        t += d * 0.6;
    }

    vec3 col = vec3(0.0);
    vec3 lightColor = vec3(1.0, 0.9, 0.7); // Warm Light

    if(t < MAX_DIST) {
        vec3 p = ro + rd * t;
        // Apply rotation for shading
        p.xz *= rot(t_rot * 0.3);
        p.xy *= rot(t_rot * 0.1);

        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        // --- MATERIAL ---
        // Texture
        float tScale = (u_tex_scale < 0.1) ? 0.4 : u_tex_scale;
        vec3 tex = triplanar(p, n, tScale);

        // Orbit Trap Color
        float trap = fract(map(p) * 10000.0);
        vec3 machineCol = mix(vec3(0.4, 0.5, 0.6), vec3(0.7, 0.6, 0.4), trap);

        vec3 albedo = tex * machineCol * 1.5;

        // Roughness map from texture red channel
        float rough = (u_roughness < 0.0) ? 0.5 : u_roughness;
        float roughness = rough + texture(iChannel1, p.xy * 0.1).r * 0.3;

        // --- LIGHTING ---
        float lx = (u_light_x == 0.0) ? 5.0 : u_light_x;
        float ly = (u_light_y == 0.0) ? 6.0 : u_light_y;
        vec3 lightPos = vec3(sin(iTime)*lx, ly, cos(iTime)*lx);
        vec3 l = normalize(lightPos - p);

        float diff = max(dot(n, l), 0.0);

        // Shadow Softness
        float shadowK = (u_shadow_soft < 1.0) ? 16.0 : u_shadow_soft;
        float shadow = softshadow(p + n * 0.02, l, shadowK);

        // AO Strength
        float aoStr = (u_ao_strength < 0.0) ? 1.0 : u_ao_strength * 3.0;
        float ao = calcAO(p, n);
        ao = mix(1.0, ao, aoStr); // Blend AO strength

        // Specular
        float spec = pow(max(dot(ref, l), 0.0), 16.0 * (1.0-roughness));

        // Composition
        vec3 ambient = vec3(0.05, 0.07, 0.1) * ao; 
        vec3 direct = lightColor * diff * shadow;
        vec3 specular = lightColor * spec * shadow * 2.0;

        // Glow Intensity
        float glowAmt = (u_glow_str < 0.0) ? 0.5 : u_glow_str;
        vec3 emission = vec3(0.9, 0.3, 0.1) * pow(1.0-ao, 3.0) * glowAmt;

        col = albedo * (ambient + direct) + specular + emission;
    }

    // --- ATMOSPHERE ---
    // Fog Density
    float fogDens = (u_fog_density < 0.0) ? 0.08 : u_fog_density * 0.2;

    vec3 fogCol = vec3(0.1, 0.12, 0.15) * (1.0 + rd.y*0.5); 
    vec3 lightDir = normalize(vec3(sin(iTime), 0.6, cos(iTime)));
    float sunScatter = pow(max(dot(rd, lightDir), 0.0), 8.0);
    fogCol += lightColor * sunScatter * 0.5;

    float fogAmount = 1.0 - exp(-t * fogDens);
    col = mix(col, fogCol, fogAmount);

    col = pow(col, vec3(0.4545)); // Gamma
    col = smoothstep(0.0, 1.0, col); // Contrast

    fragColor = vec4(col, 1.0);
}

